import React from "react";
function MbtiPicture() {

    //mbti 에 맞게 if 또는 case 해서 사진을 띄워야된다 토큰
    let mbti ="img/bg5.jpg"

return(
    <div class="result-box">
        <div class="result-box-title">
            <div class="img-halt-box">
                <ui class="list">
                    <img
                    className="mbtipicture"
                    //alt="bg5"
                    src={mbti}/>
                </ui>
            </div>
        </div>
    </div>
)
}
export default MbtiPicture;
